export default {
  async generateStyledPDF() {
    const rows = Get_Full_Details_of_Included_T.data;
    if (!rows || rows.length === 0) {
      showAlert("No data found", "error");
      return;
    }

    const { jsPDF } = jspdf;
    const doc = new jsPDF("p", "pt", "a4");
  const logoBase64 = "data:image/png;base64,";

		
const pageWidth = doc.internal.pageSize.getWidth();
const imageWidth = 80;
const xPosition = pageWidth - imageWidth - 40; // 40 is the right margin
// ✅ Add Logo
doc.addImage(logoBase64, "PNG", xPosition, 20, imageWidth, 50);

// ✅ Title: Note of Professional Charges
doc.setFont("Helvetica", "bold");
doc.setFontSize(11);

const text = "Note of Professional Charges";
doc.text(text, pageWidth / 2, 90, { align: "center" });

// Calculate text width for underline
const textWidth = doc.getTextWidth(text);
const startX = (pageWidth - textWidth) / 2;
const startYy = 92; // slightly below text baseline

// Draw underline
doc.setLineWidth(0.5);
doc.line(startX, startYy, startX + textWidth, startYy);


// ✅ Client Details Section
doc.setFontSize(11);
let startY = 130;
const leftX = 40;
const midX = 150;

const clientDetails = [
  { label: "Client:", value: Invoice_Header.selectedRow.ClientName },
  { label: "File No.:", value: Invoice_Header.selectedRow.MatterCode },
  { label: "Invoice No.:", value: invoiceFiled.text?.toString().trim() !== "" ? invoiceFiled.text.toString() : "-" },
  { label: "Re:", value:Invoice_Header.selectedRow.MatterName },
  { label: "Date:", value: Invoice_Header.selectedRow.InvoiceDate },
];

clientDetails.forEach((item, i) => {
  doc.setFont("Helvetica", "bold");
  doc.text(item.label, leftX, startY + i * 20);
  doc.setFont("Helvetica", "normal");
  doc.text(item.value || "-", midX, startY + i * 20);
});

const headers = [["Description", "Amount in U.S. Dollars"]];
const data = [
  ["Professional Charges (as per attached breakdown)", totalCost.text.toFixed(2)],
  ["Total", totalCost.text.toFixed(2)],
];

doc.autoTable({
  head: headers,
  body: data,
  startY: startY + 140,
  theme: "grid",
  styles: {
    font: "Helvetica",
    fontSize: 11,
    cellPadding: 6,
  },
  headStyles: {
    fillColor: [230, 230, 230], // light gray
    textColor: 0,
    halign: "center",
    fontStyle: "bold",
  },
  columnStyles: {
    0: { halign: "left" },
    1: { halign: "right" },
  },
  didParseCell: function (data) {
    const row = data.row;
    if (row.index === 1) {
      // Last row (Total)
      data.cell.styles.fillColor = [180, 180, 180]; // darker gray
      data.cell.styles.fontStyle = "bold";
      data.cell.styles.textColor = 20;
    }
  },
});

let currentY = doc.previousAutoTable.finalY + 30;
doc.setFont("Times New Roman", "bold");

const amountText = convertAmountToWords.convertAmountToWords(parseFloat(totalCost.text));

doc.text(
  `Total Amount Due:   ${amountText}`,
  leftX,
  currentY
);


// ✅ Method of Payment
const paymentText = [
  "Method of Payment:",
  "",
  "Kindly arrange for the transfer of the amount to our bank account with the Capital",
  "Bank of Jordan with the following particulars:",
  "",
  "ACCOUNT NAME: ALI SHARIF ZU'BI ADVOCATES & LEGAL CONSULTANTS",
  "ACCOUNT NO.: 0123/012432/00",
  "CAPITAL BANK OF JORDAN",
  "SWIFT CODE : EFBKJOAM",
  "",
  "                 CORRESPONDING BANK:",
  "                 BANK OF NEW YORK",
  "                 HEAD OFFICE",
  "                 48 WALL STREET",
  "                 NEW YORK, NEW YORK 10286",
  "                 ACC. NO. 890031305",
  "                 SWIFT CODE: IRVTUS3N",
  "                 ABA No. 021000018",
  "",
  "(PLEASE INSERT COMPANY NAME AND INVOICE NUMBER FOR IDENTIFICATION PURPOSES)",
];

// ✅ Lines that need to be bolded
const boldLines = new Set([
  "ACCOUNT NAME: ALI SHARIF ZU'BI ADVOCATES & LEGAL CONSULTANTS",
  "ACCOUNT NO.: 0123/012432/00",
  "CAPITAL BANK OF JORDAN",
  "SWIFT CODE : EFBKJOAM",
  "(PLEASE INSERT COMPANY NAME AND INVOICE NUMBER FOR IDENTIFICATION PURPOSES)",
]);

let y = doc.previousAutoTable.finalY + 40; // Adjust as needed
const lineSpacing = 18; // Adjust line spacing if needed

paymentText.forEach(line => {
  const isBold = boldLines.has(line.trim());
  doc.setFont("Times New Roman", isBold ? "bold" : "normal");
  doc.text(line, leftX, y);
  y += lineSpacing;
});


// ✅ Output
const dataUri = doc.output("datauristring");
await storeValue("pdfDataUri", dataUri);

const blob = doc.output("blob");
const reader = new FileReader();
reader.onloadend = async () => {
  await storeValue("pdfBase64", reader.result);
  showAlert("Invoice PDF is ready.", "success");
	
	navigateTo('Page1', {}, 'NEW_WINDOW'); 
};
reader.readAsDataURL(blob);
  }
}